import React from "react";
import { Entry } from "../types";

const EntryDetails: React.FC<{entry: Entry| undefined}> = ({entry})=>{

switch (entry.type) {
  case "HealthCheck":
    return (
      <h1>Health Check</h1>
    );
  case "Hospital":
    return(
      <h1>Hospital</h1>
    );
  case "OccupationalHealthcare":
    return(
      <h1>Occupational Health Care</h1>
    )
  default:
    break;
}

}
export default EntryDetails;
